import React from "react";
import { FaCheckDouble } from "react-icons/fa";

const Bought = () => {
  return (
    <h1
      style={{
        position: "absolute",
        left: "50%",
        top: "50%",
        transform: "translate(-50%, -50%)",
      }}
    >
      <FaCheckDouble size={300} style={{ color: "green" }} />{" "}
    </h1>
  );
};

export default Bought;
